import Card from './Card';

const CardList = ({robots}) => (
  <div key={robots.id}>
    {robots.map(({ id, name, username, email } = robots) => (
        <Card 
          key={id}
          id={id}
          name={name}
          username={username}
          email={email}
        />
      ))}
  </div>
);

export default CardList
